import java.util.*;
class solution {
    public static List<Integer> findAnagrams(String s, String p) {
        //滑动窗口
        List<Integer> res = new LinkedList<>();
        int len_s = s.length();
        //System.out.println(len_s);
        int len_p = p.length();
        //System.out.println(len_p);
        int count_match = 0;

        if(len_s < len_p) return res;
        Map<Character, Integer> map_p = new HashMap<>();
        Map<Character, Integer> map_s = new HashMap<>();
        int left = 0, right = 0;
        for(int i=0; i<len_p; i++){
            map_p.put(p.charAt(i), map_p.getOrDefault(p.charAt(i),0)+1);
        }
        //System.out.println(map_p.keySet());
        int len_need = map_p.size();
        //int flag = 0;
        while(right<len_s){
            char right_cur = s.charAt(right);
            if(map_p.containsKey(right_cur)) {
                map_s.put(right_cur,map_s.getOrDefault(right_cur,0)+1);

                //System.out.println(map_s.get(right_cur));
                //System.out.println(map_p.get(right_cur));

                if(map_s.get(right_cur).equals(map_p.get(right_cur))) {
                    count_match++;
                    //System.out.println(count_match);
                }
            }

            right++;
            while(count_match == len_need){
                if(right-left == len_p) {
                    res.add(left);
                }
                char left_cur = s.charAt(left);
                if(map_p.containsKey(left_cur)){
                    map_s.put(left_cur, map_s.get(left_cur)-1);
                    if(map_s.get(left_cur)<map_p.get(left_cur))
                        count_match--;
                }
                left++;
            }
        }
        return res;
    }
    public static void main(String[] args){
        //String s = "";
        //String p = "";

        StringBuilder sb_s = new StringBuilder();
        StringBuilder sb_p = new StringBuilder();
        for(int i=0; i<1000; i++) sb_s.append('a');
        sb_s.append('b');
        for(int i=1001;i<2001;i++) sb_s.append('a');
        String s = sb_s.toString();
        for(int i=0; i<1000;i++) sb_p.append('a');
        String p = sb_p.toString();
        HashMap<Character,Integer> hm = new HashMap<>();
        for(int i=0; i<s.length();i++) hm.put(s.charAt(i),hm.getOrDefault(s.charAt(i),0)+1);
        //System.out.println(hm.get('b'));

        //System.out.println(s.length());
        //System.out.println(p.length());
        List<Integer> list = findAnagrams(s,p);
        for(int i=0; i<list.size();i++)
            System.out.println(list.get(i));

    }
}
